struct m {
  signed n : 18;
  signed o : 1;
};
int r;
static signed s = -5L;
unsigned t;
int u;
unsigned v;
long fn4() {
  struct m ad = {1957};
  ad.o = fn1(v, 5);
  signed ae;
  int af = t;
  ae = ad.o;
  ad.o = u;
  r = af % (~s / ae);
  ad.o;
}
int main() { fn4(); }
